The term "Transfer" shall mean any sale, assignment, gift, pledge, mortgage or any other encumbrance, transfer by bankruptcy, transfer by judicial order, merger, consolidation, share exchange, transfer by operation of law or otherwise, whether direct or indirect, voluntary or involuntary, of this Agreement or any interest in it, or any rights or obligations arising under it, or of any material portion of your assets, or of any interest in you.  You (and your shareholders, partners and members) will not directly or indirectly make a Transfer without our prior written consent.  We will not withhold our consent to a Transfer, subject to all of the following conditions being satisfied: 

            1.    You are in full compliance with this Agreement, you have no uncured defaults, all your fees, debts and financial obligations to us, our affiliates and the Fund are current, and you are current in your required local advertising expenditures; 

            2.    You execute a written agreement in a form satisfactory to us in which you and your owners covenant to observe all applicable post-term obligations and covenants contained in this Agreement;


            3.    The proposed transferee enters into a written agreement in a form satisfactory to us assuming and agreeing to discharge all of your obligations and covenants under this Agreement for the remainder of its term or, at our option, execute our then-current standard form of franchise agreement (which <omitted> may provide for different fees, advertising requirements, duration, and other rights and obligations from those provided in this Agreement); 

            4.    The proposed transferee agrees in writing to perform such maintenance, remodeling and re-equipping of the Restaurant that we determine necessary to bring the Restaurant in compliance with our then-current standards; 

            5.    Prior to the date of the proposed Transfer, the proposed transferee's management team successfully completes such training and instruction as we deem necessary; 

            6.    We are satisfied that the proposed transferee (and if the proposed transferee is an entity, all holders of any interest in such entity) meets all of the requirements for our new franchisees applicable on the date we receive notice of the proposed transfer and including, but not limited to, good reputation and character, business experience, restaurant management experience, and financial strength and liquidity; 

            7.    You and all holders of an interest in you execute a general release, in the form prescribed by us, releasing, to the fullest extent permitted by law, all claims that you or any of your investors may have against us and our affiliates, including our and their respective shareholders, officers, directors and employees, in both their individual and corporate capacities; 

            8.    You pay us a transfer fee equal to one-half (1/2) of the then-current Initial Franchise Fee; and 

            9.    We waive our right of first refusal under Paragraph XX. (Pages 18-19)

In the event of your death or incapacity, or the death or incapacity of any partner, any shareholder owning fifty percent (50%) or more of your capital stock, or any Member who owns a majority interest in a limited liability company, the heirs, beneficiaries, devisees, or legal representatives of said individual, partner or shareholders shall, within one hundred eighty (180) days of such event: 

            1.    Apply to us for the right to continue to operate the franchise for the duration of the term of this Agreement and any renewals hereof, which right shall be granted upon the fulfillment of all of the conditions set forth in Paragraph XVIII. of this Agreement (except that no transfer fee shall be required); or 

            2.    Sell, assign, transfer, or convey your interest in compliance with the provisions of Paragraphs XVIII and XX of this Agreement; provided, however, in the event a proper and timely application for the right to continue to operate has been made and rejected, the one hundred eighty (180) days to sell, assign, transfer or convey shall be computed from the date of said rejection.  For purposes of this Paragraph, our silence on an application made pursuant to Paragraph XIX.A.1. through the one hundred and eighty (180) days following the event of death or incapacity shall be deemed a rejection made on the last day of such period. (Page 19)

In the event of the death or incapacity of an individual franchisee, or any partner or shareholder of you which is a partnership or corporation, where the aforesaid provisions of Paragraph XVIII have not been fulfilled within the time provided, all rights licensed to you under this Agreement shall, at our option, terminate forthwith and we will have the option to purchase the assets of the Franchised Restaurant in accordance with Paragraph XVII.K. herein. (Page 20)

Any proposed transfer by you (regardless of the form of transfer) shall be subject to the same terms and conditions contained in the Franchise Agreement.  As used herein, the term "Transfer" shall mean any sale, assignment, gift, pledge, mortgage or any other encumbrance, transfer by bankruptcy, transfer by judicial order, merger, consolidation, share exchange, transfer by operation of law or otherwise, whether direct or indirect, voluntary or involuntary, of the Agreements or any interest in any of them or any rights or obligations arising under them, or of any material portion of the business assets, or of any interest in the Franchisee.  Each of you agree and covenant that you will not at any time during which Franchisee is a Buffalo Wild Wings/bw-3 franchisee and/or developer, directly or indirectly, voluntarily or involuntarily, make any Transfer, unless you first obtain our written approval in compliance with the same provisions applicable to a transfer by you as set forth in the Agreements. (Page 26)

AT&T and its auditors (including internal audit staff and external auditors) and governmental authorities shall have the right to review such records (“AT&T Audits”) held and created by Vendor, to verify the following: 

(i) the accuracy of Vendor’s invoices and AT&T’s payment obligations hereunder; 

(ii) that the Work charged for was actually performed; 

(iii) that the Services have been and are being provided in accordance with this Agreement; 

(iv) the integrity of Vendor’s systems that process, store, support, maintain, and transmit AT&T data; 

(v) Vendor’s records relating to the performance of Vendor’s Subcontractors with respect to any portion of the Services; and 

(vi) that Vendor and its Subcontractors are complying with Section 3.6 hereof. (Page 39)

When the FirstNet Authority or other governmental authority requests to review Vendor’s records, AT&T and its auditors will review these records first if the FirstNet Authority or other governmental authority permits such review, and provide the records to the requesting governmental authority; provided, however, the FirstNet Authority and other governmental authorities retain the right to perform audits independent of AT&T. (Page 39)

Subject to Subsection (g) below, Vendor shall provide and shall require that its Subcontractors provide to AT&T, its auditors (including internal audit staff and external auditors), and governmental authorities access at all reasonable times to: 

(i) any facility at which the Services or any portion thereof are being performed; 

(ii) systems and assets used to provide the Services or any portion thereof; 

(iii) Vendor employees and Subcontractor employees providing the Services or any portion thereof; and 

(iv) all Vendor and Subcontractor records, including financial records relating to the invoices and payment obligations and supporting documentation, pertaining to the Services. (Page 40)

The scope of AT&T Audits shall also include: 

(i) practices and procedures used in performing the Services; 

(ii) systems, communications and information technology used in performing the Services; 

(iii) general controls and security practices and procedures; 

(iv) supporting information and calculations regarding invoices and compliance with service requirements; 

(v) quality initiatives and quality assurance; and 

(vi) compliance with the terms of this Agreement. (Page 40)

AT&T’s access to the records and other supporting documentation shall include the right to inspect and photocopy Vendor’s documentation and the documentation of its Subcontractors as provided to Vendor, and the right to retain copies thereof outside of their physical location with appropriate safeguards, if such retention is deemed reasonably necessary by AT&T and only to the extent that all such records are maintained by AT&T in accordance with Section 3.16 hereof. (Page 40)

AT&T Audits may be conducted once a year (or more frequently if requested by governmental authorities who regulate AT&T’s business, if required by applicable Law or if auditors require follow-up access to complete audit inquiries or if an audit uncovers any problems or deficiencies), upon at least ten (10) business days advance notice (unless otherwise mandated by Law) and during business hours. Vendor will cooperate, and will ensure that its Subcontractors cooperate, in the AT&T Audits, and will make the information reasonably required to conduct the AT&T Audits available on a timely basis. (Page 40)

Vendor will provide AT&T, at AT&T’s request and cost, with paper and electronic copies of documents and information reasonably necessary to verify Vendor’s compliance with this Agreement. (Page 41)

With respect to AT&T requests for audits or inspections of Vendor’s Subcontractors, the following applies: 

(i) If Vendor’s agreement with its applicable Subcontractor permits an AT&T Audit, AT&T shall be permitted to conduct such audit directly or through a third party representative. Vendor shall work with AT&T in facilitating the Subcontractor’s cooperation for an expeditious and thorough audit or inspection. 

(ii) If Vendor’s contract with its applicable Subcontractor precludes AT&T from directly conducting an audit or inspection, Vendor shall use reasonable best efforts to enable AT&T to perform an audit of the Subcontractor with Vendor coordinating the audit process. Failing those efforts, Vendor shall, upon AT&T’s request and at AT&T’s expense, conduct the audit or inspection on behalf of AT&T, subject to terms agreed to by Vendor and AT&T for the Subcontractor audit, such as areas to be audited, applicable fees, and the timeframe for reporting audit results to AT&T. If AT&T’s request for a Vendor audit or inspection arises from, in AT&T’s good faith opinion, materially or consistently deficient Service provided by the Subcontractor under AT&T’s account, and the audit in both Parties’ opinions confirms such deficiencies, Vendor shall not charge AT&T a fee for the Vendor’s audit of its Subcontractor. 

(iii) If Vendor’s contract with its applicable Subcontractor does not allow Vendor access to the facilities and systems of Subcontractor required to conduct the audit described in Subsection (b) above, then Vendor shall provide a list of such Subcontractors and the services being provided by such Subcontractor to AT&T for its review. To the extent AT&T deems it reasonably necessary to require such access, then Vendor will renegotiate its contract with the applicable Subcontractor in order to obtain the audit rights described in Subsection (b) above. (Page 41)

Failing those efforts, Vendor shall, upon AT&T’s request and at AT&T’s expense, conduct the audit or inspection on behalf of AT&T, subject to terms agreed to by Vendor and AT&T for the Subcontractor audit, such as areas to be audited, applicable fees, and the timeframe for reporting audit results to AT&T (Page 41)

AT&T may inspect and inventory the material furnished by AT&T under this Agreement during Vendor’s normal business hours. (Page 48)

Prior to Location Acceptance, Vendor shall provide AT&T escorted access to the premises wherein all such material is located and, following Location Acceptance, AT&T shall have access to the premises wherein all such material is located pursuant to the terms of the Master License Agreement and the applicable Site License thereunder or any third party Tower Lease, as applicable. (Page 48)

Vendor shall provide to AT&T (or its third party delegate), upon request and at no charge, its parent company, ATN International, Inc.’s bona fide and unedited: (a) financial statements for each quarter of each fiscal year during the term of the Build Addendum and (b) audited fiscal year financial statements for each fiscal year during the Term hereof. (Page 57)

Pretzel  Time or its  designee  shall have the right at any time during business  hours and without prior notice to  Franchisee,  to inspect,  audit and copy or the right to cause to be  inspected,  audited and copied,  the  business records,  bookkeeping and accounting  records,  sales and income tax records and returns and other records of the Franchised Business,  including but not limited to,  daily  cash  reports,  cash  receipts  journal  and  general  ledger,  cash disbursements  journal and weekly payroll register,  monthly bank statements and daily deposit slips and cancelled checks; tax returns,  supplier invoices, dated cash register tapes, weekly inventories, sales reports, financial statements and tax returns and the books and records of any  corporation or  partnership  which holds the Franchise  including the personal financial records and tax returns of the Franchisee during and after the term of the Franchise Agreement. (Page 26)

Franchisee shall fully cooperate with Pretzel Time's representatives and independent accountants hired by Pretzel Time to conduct any such inspection or audit. (Page 26)

The audit will be conducted at the expense of Pretzel Time, provided that if an audit  disclosed an  understatement  of two percent (2%), as described above,  Franchisee will bear the cost of the audit,  including without limitation,  the charges of attorneys  and any  independent  accountants,  their travel   expenses,   room  and  board,   and   compensation  of  Pretzel  Time's representatives  and  independent  accountants. (Page 27)

Providing  that in no case will Franchisee be obligated to pay more than ten thousand dollars ($10,000) for such inspection  or audit  costs. (Page 27)

To determine  whether  Franchisee  and the Unit are complying with this Agreement and with all Pretzel Time's  standards and operations as prescribed by Pretzel Time,  Pretzel Time or its designated agents shall have the right at any reasonable time and without prior notice to Franchisee to: 

         a.  Inspect the Unit; 

         b. Observe,  photograph  and video tape the Unit's  operations for such          consecutive or intermittent periods as Pretzel Time deems necessary; 

         c. Remove  samples of any  Products,  materials or supplies for testing and analysis; 

         d.  Interview personnel of the Unit; 

         e.  Interview customers of the Unit; and 

         f. Inspect and copy any books,  records and  documents  relating to the          operation  of the Unit.  Franchisee  agrees  to  cooperate  fully  with          Pretzel Time in connection with any such inspections, observations,  photographing,  video  taping,  Product  removal and  interviews. Franchisee  shall present to his customers  such comment or evaluation  forms as Pretzel Time periodically  prescribes and shall  participate  and/or request his customers  to  participate  in any surveys  performed by or on behalf of Pretzel Time. (Page 27)

This Agreement is effective as of the Effective Date and will expire in accordance with Section 2.1, unless, upon the occurrence of any of the following events, this Agreement is earlier terminated in accordance with this Section 18.1: 

a) Customer delivers written notice of termination to Supplier at least [* * *] prior to the expiration date of the Initial Term, which termination shall be effective as of the expiration date of the Initial Term; 

b) either Party delivers written notice of termination to the other Party at least [* * *] prior to the expiration date of the Renewal Term, which termination shall be effective as of the expiration date of the Renewal Term; (Page 38)

During the Term of the Agreement, LMG shall maintain and keep in force, at its own expense, the following minimum insurance coverages and minimum limits: 

workers‚Äô compensation insurance, with statutory limits as required by the various laws and regulations applicable to the employees of LMG; 

employer‚Äôs liability insurance, for employee bodily injuries and deaths, with a limit of $500,000 each accident; 

commercial general liability insurance, covering claims for bodily injury, death and property damage, including premises and operations, LMG‚Äôs vicarious liability for acts of independent contractors, products, services and completed operations (as applicable to the Services), personal injury, contractual, and broad-form property damage liability coverages, with combined single limit of $1,000,000 per occurrence, and a general aggregate limit of $2,000,000, for bodily injury, death and property damage; 

commercial automobile liability insurance, covering owned, non-owned and hired vehicles, with combined single limit of $1,000,000 per occurrence; 

umbrella liability insurance, with a minimum limit of $5,000,000 per occurrence and $5,000,000 in the aggregate; 

special form property insurance, on a replacement cost basis, covering the real and personal property of LMG which LMG is obligated to insure by the Agreement; such real and personal property may include equipment, furniture, fixtures and supply inventory; and 

employee dishonesty insurance covering dishonest acts of employees; such insurance shall include a Joint Loss Endorsement in favor of TAG and be written for limits not less than $500,000. (Page 9)

TAG shall be named as loss payee as its interest may appear on the property insurance policies of LMG. LMG shall be responsible for payment of any and all deductibles from insured claims under its policies of insurance. (Page 10)

All required policies of insurance will be placed with insurers with no less than an A.M. Best rating of A- VII. (Page 10)

Metavante currently maintains and, if available at a reasonable cost, Metavante shall continue to pay for, and maintain in full force and effect during the Term insurance as follows: 

A. Workers‚Äô compensation and employers‚Äô liability insurance with limits to conform with the greater of the amount required by Wisconsin applicable state statutory law or one million dollars ($1,000,000) each accident, including occupational disease coverage; 

B. Commercial general liability insurance with limits not less than three million dollars ($3,000,000) combined single limit for bodily injury, death, and property damage, including personal injury, contractual liability, independent contractors, broad-form property damage, and products and completed operations coverage; 

C. Commercial automobile liability insurance with limits not less than one million dollars ($1,000,000) each occurrence combined single limit of liability for bodily injury, death, and property damage, including owned and non-owned and hired automobile coverages, as applicable; 

D. Commercial Blanket Bond, including Electronic & Computer Crime or Unauthorized Computer Access coverage, in the amount of not less than ten million dollars ($10,000,000); and 

E. Professional liability insurance (Errors and Omissions) with limits not less than three million dollars ($3,000,000) annual aggregate for all claims each policy year for computer programming and electronic data processing services. (Page 10)

To the extent any insurance coverage required under this Section is purchased on a ‚Äúclaims-made‚Äù basis, such insurance shall cover all prior acts of Metavante during the Term, and such insurance shall be continuously maintained until at least four (4) years beyond the expiration or termination of the Term, or Metavante shall purchase ‚Äútail‚Äù coverage, effective upon termination of any such policy or upon termination or expiration of the Term, to provide coverage for at least four (4) years from the occurrence of either such event. (Page 10)

Certificates of Insurance evidencing all coverages described in this Section shall be furnished to Customer upon request. (Page 10)

